          type={"text"}
          placeholder={""}/>
          <Input
          name={"topicId"}
          text="Topic Id"
          state={topicId}
          setStateFun={settopicId}
          type={"text"}
          placeholder={""}/>
          <Input
          name={"topicId"}
          text="Topic Id"
          state={topicId}
          setStateFun={settopicId}
          type={"text"}
          placeholder={""}/>

            </div>
        </form>
    </div>
  )
}

export default AddTopicToExam
